INSERT INTO `disease` (`Disease_Id`, `Name`, `Description`, `Duration`, `Precaution`, `Image`) VALUES
(24, 'Hand, foot, and mouth disease', 'Hand, foot, and mouth disease is a common infection caused by a group of viruses. It typically begins with a fever and feeling generally unwell. This is followed a day or two later by flat discolored spots or bumps that may blister, on the hands, feet and mouth and occasionally buttocks and groin. Signs and symptoms normally appear 36 days after exposure to the virus. The rash generally resolves on its own in about a week. Fingernail and toenail loss may occur a few weeks later, but they will regrow with time', 'Usually will recover in 1 week', 'Please always clean yourself (such as handwashing) to prevent infected by the disease. ', );
INSERT INTO `disease` (`Disease_Id`, `Name`, `Description`, `Duration`, `Precaution`, `Image`) VALUES
(64, 'COVID-19', 'Coronavirus disease 2019 (COVID-19) is an infectious disease caused by severe acute respiratory syndrome coronavirus 2 (SARS-CoV-2). The virus is primarily spread between people during close contact, most often via small droplets produced by coughing, sneezing, and talking. The droplets usually fall to the ground or onto surfaces rather than travelling through air over long distances. Less commonly, people may become infected by touching a contaminated surface and then touching their face. It is most contagious during the first three days after the onset of symptoms, although spread is possible before symptoms appear, and from people who do not show symptoms.', 'The time from exposure is typically around 5 days but may range from 2 to 14 days.\n\n', 'Always wash your hand, cover your face when going out, keep social distancing, and make a self quarantine if you suspect to have the disease', );
INSERT INTO `disease` (`Disease_Id`, `Name`, `Description`, `Duration`, `Precaution`, `Image`) VALUES
(65, 'Foodborne Illness', 'Foodborne illness (also foodborne disease and colloquially referred to as food poisoning) is any illness resulting from the spoilage of contaminated food, pathogenic bacteria, viruses, or parasites that contaminate food, as well as toxins such as poisonous mushrooms and various species of beans that have not been boiled for at least 10 minutes. Symptoms is always vary depending on the cause. For contaminants requiring an incubation period, symptoms may not manifest for hours to days, depending on the cause and on quantity of consumption. Longer incubation periods tend to cause sufferers to not associate the symptoms with the item consumed, so they may misattribute the symptoms to gastroenteritis, for example.', 'Most cases of food poisoning last about 1 to 2 days and symptoms resolve on their own', '1. Wash hands and surfaces often.\n2. Don\'t cross-contaminate.\n3. Cook to proper temperatures.\n4. Refrigerate promptly.', );
INSERT INTO `disease` (`Disease_Id`, `Name`, `Description`, `Duration`, `Precaution`, `Image`) VALUES
(66, 'Influenza (Flu)', 'Influenza, commonly known as \"the flu\", is an infectious disease caused by an influenza virus. Usually, the virus is spread through the air from coughs or sneezes. This is believed to occur mostly over relatively short distances. It can also be spread by touching surfaces contaminated by the virus and then touching the eyes, nose, or mouth. A person may be infectious to others both before and during the time they are showing symptoms. The infection may be confirmed by testing the throat, sputum, or nose for the virus.', 'Around 1 week', 'Frequent hand washing reduces the risk of viral spread, as does wearing a surgical mask.', );

